INSERT INTO conteudo VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 2 - Recursos Educacionais Abertos (REA)', 'Definição', 'video', 'O que são REAs|$<p>A informação que antes ficava restrita a um grupo de pessoas ou universidades passou a ser acessível por meio da internet. Esses chamados de repositórios abertos contem os objetos de aprendizagem. Segundo Matta e Figueiredo eles podem estar relacionados ou não a um curso ou programa de estudos e representam uma significativa opção para estender e democratizar o acesso ao conhecimento, à racionalização de despesas com livros-textos e outros materiais para aprendizagem em todos os níveis.</p>
Abaixo segue um video explicativo retirado do caderno de educação aberta, Disponível em: http://educacaoaberta.org/cadernorea.<br><br>|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 4 - Contexto e comportamento do sistema', 'Diagrama de contexto', 'imagem', 'Diagrama de casos de usabilidade|Atores|$Os requisitos deste projeto foram levantados com base no estudo de artigos de autores correlatos sobre ensino a distancia e da analise detalhada das principais plataformas de cursos abertos massivos apresentados pela Sociedade Brasileira de Computação. Paula Filho explica que no fluxo de requisitos  o "Detalhamento dos requisitos funcionais" utiliza a notação de casos de uso para representar uma fatia de funcionalidade do produto. Ou seja, a representação de um cenário para uma funcionalidade específica que o sistema deverá exercer. |São representados também os dois únicos atores que irão interagir com o sistema. Por se tratar de um sistema de aulas, toda a relação ocorrerá entre um indivíduo que queira hospedar um curso e um ou mais alunos que irão usufruir do conteúdo deste curso.|#sessao|link|sessao|&');
INSERT INTO conteudo VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 1 - Ensino a distancia', 'Educação a distancia no brasil', 'video', 'O papél da EAD|$Para os autores Forno e Knoll  a educação aberta tem em comum a remoção de barreiras ao acesso à educação, desde físicas, temporais, individuais, sociais, e de aprendizagem. Esta última característica permite a criação de rotas próprias de estudo, com objetivos de aprendizagem claros e bem definidos. Segundo os autores é no âmbito das universidades abertas que a educação aberta a distancia se desenvolve, atendendo a diferentes objetivos daqueles que a procuram a partir de uma estrutura similar, em geral modular.<br><br>
O video abaixo demonstra uma reportagem do jornal Bom Dia Brasil sobre o recente sucesso da educação a distancia no Brasil<br><br>|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 1 - Ensino a distancia', 'Camadas da EAD', 'imagem', 'Camadas da EAD|$A educação é um processo complexo e envolve vários fatores culturais, econômicos, políticos e técnicos. No trabalho dos autores Inuzuka e Duarte a Educação Aberta é composta em camada física que corresponde a computadores, software, acesso a internet, a camada lógica contendo as teses, módulos, livros didáticos e artigos de pesquisa, a camada simbólica onde são representados os processos de aprendizado, relações internas e cruzadas entre alunos e professores e por fim a camada humana que contem a prática e pedagógica. (Abdo, 2011, citado por Inuzuka e Duarte, 2012).<br><br>

A figura abaixo demonstra as quatro camadas da EAD: <br><br>|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 1 - Ensino a distancia', 'Benefícios da EAD', 'imagem', 'Benefícios da EAD|$Abaixo segue um infográfico:<br><br>|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 4 - Contexto e comportamento do sistema', 'Diagrama de sequência', 'imagem', 'Diagramas de sequência|$Os diagramas de sequência oferecem uma representação temporal do fluxo dos casos de uso. São representados aqui alguns exemplos:|#sessao|link|link|&');
INSERT INTO conteudo VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 1 - Ensino a distancia', 'Evolução tecnológica da educação', 'imagem', 'Evolução tecnológica da educação|$A Educação a distancia cresceu aceleradamente nos últimos anos, atendendo a uma demanda cada vez maior e expandindo-se pelos diversos setores e espaços, a fim de contribuir para a democratização do acesso à educação. Segundo Forno e Knoll a rápida evolução tecnológica e o maior acesso à internet têm provocado mudanças no mundo todo, facilitando e ampliando as oportunidades de aprendizagem, a qualquer tempo, em qualquer lugar. Com isso, cada vez mais, oportunidades formativas ganham espaço via internet, tanto na elaboração e condução de disciplinas de cursos de graduação e pós-graduação, nos formatos tradicionais e fechados.<br><br>
Um infográfico sobre a evolução da tecnologia na educação pode ser visto abaixo: <br><br>|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 2 - Recursos Educacionais Abertos (REA)', 'Repositorio aberto', 'imagem', 'Repositorio aberto|$Oliveira e Moreira propõem uma plataforma integrada de sistemas de gestão de conteúdos e aplicações baseadas na Web,  plataforma essa que utiliza este tipo de aplicações como complemento das plataformas de ensino a distância. No sentido de optimizar a sua utilização, a plataforma de ensino a distância funcionaria em conjunto com outros sistemas de gestão de conteúdos como sejam repositórios digitais.<br>|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 3 - Curso Online Aberto Massivo (MOOC)', 'Modelo de aprendizagem', 'imagem', 'Modelo de aprendizagem|Areas|Modelo|$<p>Para Pires, a aprendizagem no MOOC é realizada em torno de quatro tipos de atividades: Agregação, com acesso aos diversos recursos, para ler, assistir e utilizar/interagir; Relação, para relacionar os conhecimentos prévios com a nova informação; Criação, para criar algo próprio a partir do que se aprendeu; Partilha, para partilhar o seu trabalho com os outros. Para Matta e Figueiredo o MOOC pode ser definido como um modelo integra três elementos: a conectividade das redes sociais, o conhecimento de um especialista em determinada área e a coleção de recursos online abertos.</p>|Segundo Forno e Knoll , os MOOCs são cursos de curta duração, de três a 12 semanas, por exemplo, promovidos e coordenados por universidades renomadas e disponibilizados em plataformas virtuais específicas. As plataformas de MOOCs oferecem possibilidade de certificação em diferentes áreas: ciências humanas, ciências sociais aplicadas, ciências da saúde, ciências naturais, ciências exatas, etc.|Para Matta e Figueiredo  o MOOC pode ser definido como um modelo integra três elementos: a conectividade das redes sociais, o conhecimento de um especialista em determinada área e a coleção de recursos online abertos. Além de também o número de inscritos no curso. Segundo os autores sua principal característica reside no fato deste modelo “construir um engajamento ativo de dezenas ou centenas de milhares de estudantes que auto organizam sua participação de acordo com suas metas, conhecimento prévio, habilidades e interesses comuns.”|#sessao|link|sessao|sessao|&');
INSERT INTO conteudo VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 3 - Curso Online Aberto Massivo (MOOC)', 'Conectivismo infografico', 'imagem', 'Infográfico conectivismo|$Para Siemens, o ponto de partida desta teoria foi definido com base na análise das limitações de teorias de aprendizagem já estabelecidas como o behaviorismo, cognitivismo e construtivismo. <br>|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 4 - Exemplos de MOOCs', 'Plataformas moocs', 'slide', '|$|#link|&');
INSERT INTO conteudo VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 3 - Curso Online Aberto Massivo (MOOC)', 'Conectivismo slide', 'slide', 'MOOC e conectivismo|$De acordo com Kenski os MOOCS em geral baseiam-se no modelo teórico conectivista e formariam uma espécie de “redes planetárias”, pois integram comunidades virtuais ampliadas em âmbito global. Para ela, foram os novos recursos disponíveis nas tecnologias digitais que expandiram tanto a produção quanto a oferta, de cursos online em formatos diferenciados.|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 3 - Curso Online Aberto Massivo (MOOC)', 'Conectivismo', 'video', 'Conectivismo|Teoria do conectivismo|$Para Yuan e Powell os MOOCs seguem duas direções pedagógicas distintas: os MOOCs de linha conectivista, sinalizados como MOOCs, que se desenvolvem de modo mais informal na rede de forma relativamente livre das “amarras” de uma instituição tradicional de ensino, e os MOOCs de linha behaviorista sinalizados como xMOOCs. Segundo os autores os modelos xMOOCs correspondem, fundamentalmente, a uma extensão dos modelos pedagógicos utilizados pelas instituições de ensino tradicionais. Os autores também destacam que dentre os xMOOCs, há os cursos de base lucrativa e os de base não lucrativa.<br><br>
Um video explicativo sobre o conectivismo da Universidade Aberta de Lisboa pode ser conferido abaixo:<br><br>|Conectivismo é uma teoria de aprendizagem desenvolvida por George Siemens e Stephen Downes, focada na educação na era digital, que leva em consideração a forma como a tecnologia influencia nas atuais formas de comunicação e aprendizado. 
Definido por Siemens como “um modelo de aprendizagem que reconhece as mudanças tectônicas na sociedade, onde a aprendizagem não é mais uma atividade interna, individualista”, pois o modo como se aprende se altera ao se utilizarem novas ferramentas. Ainda de acordo com o autor, o conectivismo “fornece uma percepção das habilidades e tarefas de aprendizagem necessárias para os aprendizes florescerem na era digital”. 
|#sessao|link|sessao|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 3 - Interface do sistema e Arquitetura de conteúdo WEB', 'Diagrama de navegação', 'imagem', 'Diagrama de navegação|$O modelo de navegação considera a representação de como o usuário irão navegar por um elemento do webapp para outro. A Figura abaixo representa a o sitemap do projeto  com as principais paginas e o painel administrativo|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 1 - Arquitetura do sistema', 'Orientação a objetos', 'video', 'Orientação a objetos|Classes|Objetos|Encapsulamento|$<p>Dall’Olgio define que a orientação a objetos é um paradigma que representa uma filosofia de construção de sistemas, onde sua abstração é realizada pela ótica do mundo real. Os conceitos de objetos em programação se baseiam em dois paradigmas: classe e objeto. Abstrair é separar mentalmente simplificando e separando as partes do sistema para concentrar em peças mais importantes e ignorar os detalhes em primeiro momento, construindo peças bem definidas que podem ser reaproveitadas.<p>O video abaixo retirado do canal PortilloDesing resume o que se trata este conceito|Segundo Dall’Olgio uma classe é uma estrutura que define um tipo de dado contendo ou não atributos, através de variáveis, e funções, através de métodos, para manipular estes atributos. Assim os atributos e métodos correspondem respectivamente às características de um objeto e seu comportamento. |Segundo Dall’Olgio um objeto contém a mesma estrutura e propriedades de uma classe, porém sua estrutura é dinâmica porque seus atributos podem mudar de valor durante a execução de um programa. Vários objetos podem ser declarados em execução, correspondendo cada um deles a uma instancia de uma classe.	Cada instancia de uma mesma classe possui um identificador próprio e comportamento único.|Segundo Dall’Olgio as classes são orientadas a assunto, sendo responsável por um assunto diferente e possui responsabilidades sobre o mesmo. O acesso a seu conteúdo deve ser protegido por meio de mecanismos de encapsulamento. O encapsulamento define que o acesso aos membros internos do objeto deve ser feitos por métodos do próprio objeto. Se as propriedades de uma classe fossem acessadas por fora de seu escopo, a classe não pode oferecer garantias sobre os atributos que contém, perdendo assim a responsabilidade sobre eles.|#sessao|link|sessao|sessao|sessao|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 2 - Arquitetura da base de dados', 'Diagrama E-R', 'imagem', 'Modelo realacional|$<p>O estilo mais comum para um modelo de banco de dados segundo Hoffer et al  é o modelo de dados relacional. Os elementos devem ser estruturados em entradas e saídas de sistema para identificar as inter-relações entre os dados. Cada entidade da base de dados instrumenta diretamente uma classe de active descrito na lição anterior. Cada entidade contém uma série de atributos que representam os dados que são armazenados por ela. Os relacionamentos entre entidades demonstram que essas entidades possuem relações com outras entidades que podem ou não ser de cardinalidade um para um (1..1), um pra muitos (1..n), muitos pra muitos (n..n), nenhum ou um pra muitos (0..n) ou nenhum ou um para um (0..1). </p>|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 3 - Interface do sistema e Arquitetura de conteúdo WEB', 'Diagrama de conteúdo', 'imagem', 'Diagrama de conteúdo|$O modelo de conteúdo assim deve descrever o objeto de conteúdo componente do sistema web. Será utilizado aqui uma analise aprofundada para representar a hierarquia de informações usadas para descrever o componente. Criando a partir do componente uma árvore de dados para definir as relações hierárquicas entre os objetos de conteúdo. A Figura abaixo demonstra o diagrama de conteúdo web deste projeto, os componentes são representados com as cores mais escuras e os objetos as mais claras.|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 3 - Interface do sistema e Arquitetura de conteúdo WEB', 'Mapa de objetivos de usuário', 'imagem', 'Mapa de objetivos de usuário|$A figura abaixo demonstra o mapa de objetivos de usuários construído conforme os requisitos do sistema. O modelo segue as práticas recomendadas por Hoffer et al para traduzir de forma mais clara os processos de interação que o sistema irá oferecer. Os usuários são o Aluno e o Tutor. Cada objetivo do usuário é instrumentado e pode apresentar uma relação com outro objetivos. Existem também objetivos que são instrumentados indiretamente pelo sistema. |#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 5 - Linguagens e ferramentas de construção', 'PHP', 'imagem', 'PHP|$Deitel define que PHP, em inglês Personal Homepage Hypertext Processor, foi uma linguagem criado pro Rasmus Lerdorf para rastrear os usuário em seu site para posteriormente se tornar uma das linguagem de scripts mais populares para a criação de páginas dinâmicas no lado do servidor. O PHP é uma tecnologia de código aberto independente de plataforma apoiado por uma grande comunidade de usuários e desenvolvedores. O PHP surge em uma época em que se é fundamental a interatividade direta entre usuário e servidor como parte da funcionalidade Web. O PHP também oferece recursos para conectividade em banco de dados. O código PHP esta embutido nos códigos HTML e são interpretados pelo servidor antes de serem entregues ao cliente.|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 5 - Linguagens e ferramentas de construção', 'Frontend', 'slide', 'Frontend|$O slide abaixo é referente a uma palestra apresentada na III Semana Institucional da Faculdade de Imperatriz - FACIMP por Rafael Max e Davidson Felipe. Ela resume o que se trata o desenvolvimento frotend para web.|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 5 - Linguagens e ferramentas de construção', 'Postgres', 'imagem', 'Sistema de gerenciador de banco de dados Postgres|$O PostgreSQL é um poderoso sistema gerenciador de banco de dados objeto-relacional de código aberto.  Tem mais de 15 anos de desenvolvimento ativo e uma arquitetura que comprovadamente ganhou forte reputação de confiabilidade, integridade de dados e conformidade a padrões.  Roda em todos os grandes sistemas operacionais, incluindo GNU/Linux, Unix (AIX, BSD, HP-UX, SGI IRIX, Mac OS X, Solaris, Tru64), e MS Windows. Inclui a maior parte dos tipos de dados do ISO SQL:1999, incluindo INTEGER, NUMERIC, BOOLEAN, CHAR, VARCHAR, DATE, INTERVAL, e TIMESTAMP.  Suporta também o armazenamento de objetos binários, incluindo figuras, sons ou vídeos.  (postgresql.org, disponível em: https://www.postgresql.org.br/sobre)|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 1 - Arquitetura do sistema', 'Diagrama de pacotes', 'imagem', 'Pacotes lógicos|Camadas|$O diagrama de pacotes representa a divisão do sistema em camadas que contém conjuntos de objetos, sejam eles objetos de interação direta com a base de dados ou paginas html de interface. Paula Filho define que na UML os subsistemas e outros componentes são representados por pacotes lógicos. O autor define estes pacotes como “grupos de classes e outros elementos de modelagem, que apresentam fortes relacionamentos entre si (alta coesão interna) e poucos relacionamentos com elementos de outros pacotes lógicos (baixo acoplamento externo)”.|Para o Paula Filho cada camada pode usar os serviços das camadas inferiores, mas desconhece as camadas que estão acima dela, utilizando assim conceitos de herança da Orientação a Objetos. É utilizada aqui uma arquitetura usual do modelo de três camadas, que divide os produtos em camadas correspondentes aos serviços de usuário (View), contendo as interfaces, serviços de negócio (Controller), contendo os elementos implementem as regras de negócio dos caso de uso, e serviços de dados (Model), contendo os objetos persistentes e os mecanismos para armazenamento. |#sessao|link|sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 5 - Linguagens e ferramentas de construção', 'Javascript', 'imagem', 'JavaScript|$<p>JavaScript é uma linguagem de criação de scripts frontend em aplicações baseadas na Web. Deitel define que JavaScript “é uma linguagem de criação de scripts baseados em navegador desenvolvida originalmente pela Netscape”. 
Deitel afirma que os scripts são anexados ao documento HTML e geralmente são escritos na seção de <head>, que é interpretada em primeiro lugar pelo navegador. Assim os programas JavaScript são executados antes de exibir o conteúdo do body do documento. A tag script indica ao navegador que o texto em seu interior pertence um script, o tipo do script, isto é, sua linguagem é definida pelo parâmetro type.<p>
|#sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 1 - Arquitetura do sistema', 'Diagrama de classes da camada model', 'imagem', 'Diagrama de classes do pacote model|Atributos e métodos de uma classe|$<p>As classes da camada model representam diretamente os objetos que foram definidos conforme requisitos do projeto do sistema. Elas são responsáveis por realizar a persistência do objeto na base de dados.</p>
<p>As classes apresentam um conjunto de relações que segundo Paula Filho são bidirecionais. O autor também define que no projeto das classes devem idealmente ser tratadas como caixas pretas, limitando-se os efeitos de mudanças e aspectos de implementação. Os tipos de acesso são público, onde qualquer outra classe pode usar acessar o método ou atributo, protegido, onde só subclasses desta classe podem acessar e privado, onde nenhuma outra classe pode acessar diretamente.</p>
|<p>Todas as classes contém duas características que as fazem um objeto computacional: atributos que podem ser consideradas como qualidades, valores ou até mesmo outros objetos que representam a estrutura de uma classe; e métodos, que representam o comportamento e ações que a classe pode tomar para realizar alguma tarefa ou procedimento, alterando ou não seus atributos.</p>|#sessao|link|sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 1 - Arquitetura do sistema', 'Diagrama de classes da camada de controle', 'imagem', 'Diagrama de classes do pacote controller|Função das classes de controle|$<p>As classes da camada de controle são responsáveis pelo gerenciamento das classes de modelo e o fluxo de dados entre a interface e o sistema. 
Existe uma classe mãe que engloba verificações e restrições padrões de funcionamento. Todas as outras classes são filhas desta classe mãe, utilizando o conceito de herança da orientação a objetos. Todo o acesso às funcionalidades do sistema é feito acessando os métodos públicos das classes de controle.</p>
|<p>O acesso as paginas, consultas, buscas, cadastro e todas as funcionalidades que são acessadas neste sistema pela URL passam pelas classes de controle. Essas classes são o primeiro objeto que é realmente construído para exercer algum procedimento nesta plataforma. Assim ela é responsável pelo gerenciamento de dados através dos métodos das classes de model e renderização das Views para apresentação e entrada de dados.</p>|#sessao|link|sessao|link|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 2 - Arquitetura da base de dados', 'Diagrama lógico', 'imagem', 'Diagrama lógico da base de dados|Chave primária e chave estrangeria|Carinalidade|$<p>O diagrama relacional é utilizado para demonstrar as entidades e suas relações que contemplam a base de dados. Para enfim a construção seja feita é necessário mapear o diagrama relacional em um diagrama lógico que irá representar a base de dados da maneira em que a mesma será construída. A Figura abaixo demonstra a tradução e mapeamento do modelo conceitual para o modelo lógico da base de dados. O modelo lógico contém o tipo de dado da maneira em que ele irá ser utilizado pelo sistema de gerenciamento da base de dados. São definidos também as chaves primárias e estrangeiras, responsáveis por garantir a consistência da base de dados. </p>|Chaves primárias referem-se aos conjuntos de um ou mais campos, cujos valores nunca se repetem na mesma tabela e, desta forma, podem ser usadas como um índice de referência para criar relacionamentos com as demais tabela do banco de dados. Portanto, uma chave primária nunca pode ter valor nulo, nem repetição. Uma chave estrangeira faz referência a relacionamentos entre duas tabelas.|A cardinalidade define o grau de relação entre duas entidades ou tabelas. Uma das principais funções de cardinalidade é manter a integridade do banco de dados, em associação com as regras de negócio, não permitindo que essas regras sejam quebradas causando anomalias, dados repetidos ou fora de normalização. Essas associações são ligadas através de chaves (chave estrangeira e chave primária).|#sessao|link|sessao|sessao|&');
INSERT INTO conteudo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 5 - Linguagens e ferramentas de construção', 'HTML5 e CSS3', 'imagem', 'HTML|CSS3|$<p>Deitel  define a HTML como linguagem de marcação, onde é especificado o formato do texto da página que é interpretado e exibido pelo navegador web. Segundo Ernani o órgão que rege a atualização do HTML é o World Wide Web Consortium (W3C). 
Segundo Deitel , os documentos HTML são armazenados em servidores web e são solicitados pelos clientes. Um arquivo HTML contém sempre um conjunto de instruções necessárias no cabeçalho onde é definido a sintaxe básica da linguagem.  Para Ernani o HTML é uma “uma linguagem de marcação que prevê marcas em um texto chamadas de tags”.<br>
Deitel  define que a marcação do HTML contém em seu conteúdo um texto representado por elementos estruturais. Os elementos principais são o html, head que delimita a sessão de cabeçalho e body delimitando o corpo do documento. 
As delimitações entre os elementos que compõem o HTML são feitas por tags de abertura e finalização. Uma tag de abertura contém o nome do elemento por entre sinais de maior e menor, por exemplo, html, já uma tag de finalização contém o mesmo conteúdo precedido por uma barra simples (/) entre os sinais, exemplo /html. As tags de abertura possuem atributos com nome e valor separado por um sinal de igual (=), que oferecem informações e parâmetros adicionais sobre o elemento. Os atributos são interpretados pelos navegadores para determinar o elemento. <p>
|A apresentação dos elementos e sua formatação como fontes, espaçamentos, cores, dimensões, posicionamento compostas pelas estruturas de agrupamento são realizados pela tecnologia do W3C chamada Cascading Style Sheets (CSS).
Os estilos são declarados seguindo o elemento style do HTML, podendo estar contido dentro do texto ou anexado em separado através de folhas de estilo externas. Os links anexados ao documento HTML são declarados com o atributo de stylesheet. Segundo Deitel  cada propriedade CSS como font-size, font, background, height, width, color, position, display, é seguida por um sinal de dois pontos e um valor. 

|#sessao|link|sessao|link|&');


