INSERT INTO curso VALUES (19, 'fundamental', '|Como a plataforma funciona?|Os cursos são abertos?|O que mais a plataforma oferece?|Como faço a inscrição?|Como posso acompanhar meu progresso?|Como faço para me inscrever em um curso?|~#Todos os cursos da plataforma possuem a mesma pagina que é denominada classroom. Na classroom é possível navegar pelas paginas do curso, como a pagina inicial e a pagina de conteúdo programático, fórum de discussão, consultar o material adicional do curso, wikis que contém artigos anexados pelos alunos, paginas sociais do curso, realizar as lições e consultar o progresso. #O acesso a classroom é livre para qualquer pessoa que acessar a plataforma, no entanto para poder realizar interações no fórum, anexar artigos e acompanhar o progresso individual é necessário o cadastro do aluno na plataforma. O cadastro pode ser feito rapidamente acessando o menu superior direito. #A plataforma organiza os cursos por assunto que podem ser facilmente pesquisados e consultados no menu superior#A inscrição pode ser feita entrando na pagina de registro no menu superior direito. Para se cadastrar basta entrar com o email e senha.#Para verificar quais cursos você esta acompanhando você pode acessar o link do menu retrátil a esquerda e consultar "Meus cursos". São listados ali todos os cursos em que você esta inscrito, assim você poderá acompanhar seu progresso em cada um deles. Para um progresso mais detalhado basta entrar na classroom do curso e acessar a abra "Progresso".#Apos a consulta do curso na pagina inicial, categoria ou busca no menu superior você será trazido para a pagina de curso. A pagina de curso contém as informações principais do curso. Quando estiver logado no sistema você poderá se inscrever no botão esquerdo "Inscrever no curso". A inscrição poderá ser acompanhada no menu retratil "Meus cursos" e ser cancelada a seu critério.#', 'sem compromisso', 'NULL', 'REA e Mooc', '<p><b>- Modulo 1:</b> Contém uma breve descrição do que se trata REA e MOOC, comenta a evolução do ensino a distância, apresenta o uso de REA e apresenta alguns das principais plataformas MOOC atuais. </p>
<p><b>- Modulo 2:</b> Descreve como esta estruturado o sistema. Apresenta sua arquitetura, pacotes lógicos, arquitetura da base de dados, interface, comportamento dentro do contexto de usabilidade e quais linguagens e ferramentas foram utlizadas para sua construção. </p>', 1, '<h2>Sobre a demonstração</h2>
<hr>
<p class="text-justify">Esta demonstração tem por objetivo fazer um rápido ensaio para descrever do que se trata este projeto no contexto do ensino a distancia e recursos educacionais abertos. Esta plataforma foi desenvolvida como componente curricular do Trabalho Final de Graduação do aluno Kayque Willy Reis de Oliveira, do curso de Sistemas de Informação da Universidade Federal de Itajubá - UNIFEI. A demonstração contém dois módulos que dividem respectivamente o conteúdo abordado neste trabalho. O primeiro módulo se trata de ensino a distancia e o segundo módulo apresenta a estrutura da plataforma. </p>', 'nenhum', 'Demonstração da plataforma', 'CC BY-NC', 'Unifei', 41506, 'Este é um curso de demonstração que tem por objetivo contextualizar os cursos abertos online massivos (MOOC), recursos educacionais abertos (REA) e dar uma descrição breve do funcionamento da plataforma deste projeto. Este curso será utilizado como meio de validação da plataforma para verificar a sua aceitação frente a um usuário comum. Ele não requer nenhum pré requisito ou instrução.');


