INSERT INTO licao VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 4 - Exemplos de MOOCs', '<p>Serão apresentados brevemente aqui nesta lição alguns exemplos de plataformas MOOCs atuais que foram analisadas para a realização deste trabalho.</p>
<img src="https://o2lbva-dm2306.files.1drv.com/y3muowyISnq2aHaJRaXmfjcJn0dP8IluWEJS6q6GB4FlMEtmEPeT1TyfvBDk_1k6cGtoHZ6IYtNnuxyQo0ZrwrZ7l196FD8uLI4uD4KeXaOb4xZkxqhTTMOzilnuxO3aR70Uoq1smQMvS3japK2m-P1WZ_tji6ToDH6ysIxs07dgZE/samples.png?psid=1" class="img-responsive center-block"><br> ');
INSERT INTO licao VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 4 - Contexto e comportamento do sistema', ' O diagrama de contexto contém todos os relacionamentos entre os atores e os casos de usos modelados para este projeto. Assim, temos representado uma visão do modelo ambiental do sistema deste projeto através de cenários de usabilidade.  ');
INSERT INTO licao VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 1 - Arquitetura do sistema', ' <p>A arquitetura de um sistema computacional pode ser comparada a uma planta ou blueprint de qualquer projeto que é previamente planejado antes de ser de fato construído fisicamente.  Paula Filho define que uma das atividades do projeto do sistema é a atividade de “Desenho arquitetônico”, esta atividade segundo o autor “define a divisão do produto em subsistemas escolhendo as tecnologias mais adequadas”. Portanto, a arquitetura deve expressar a divisão deste sistema em subsistemas e outros componentes de nível mais baixo.<p>
<p>A arquitetura tem por objetivo expressar a representação do sistema de maneira estrutural, utilizando geralmente, abstrações do mundo real para objetos computacionais. Os objetos computacionais são organizados em componentes, módulos ou pacotes lógicos que representam seu espaço de interação e um conjunto de funcionalidades do sistema.</p> 
<img src="http://www.themetisfiles.com/wp-content/uploads/2013/01/System-Architectures1.png" class="img-responsive center-block" width="400">
<p>Existem diversos tipos de arquiteturas que são adequadas para as mais diversas situações específicas. A estruturação da arquitetura pode variar de acordo com o propósito do sistema e sua adequação. Para este projeto foi utilizada a arquitetura web cliente-servidor para instalação e uso da plataforma e o modelo de camadas MVC para organização da aplicação Web</p>  
<img src="https://upload.wikimedia.org/wikipedia/commons/thumb/1/1c/Cliente-Servidor.png/444px-Cliente-Servidor.png" class="img-responsive center-block">
 ');
INSERT INTO licao VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 2 - Arquitetura da base de dados', '<p>Para Hoffer et al  o projeto e os componentes físicos do banco de dados ocorre em duas etapas: o desenvolvimento do modelo lógico da base de dados e a prescrição técnica para arquivos de computador para armazenamento em ultima instância. O projeto do banco de dados deve fornecer estas especificações.</p>
<p>Assim, o a base de dados desta aplicação prioriza gerenciar o conteúdo que engloba os dados do curso, módulo e repositório de links do conteúdo das lições. Por se ter optado por utilizar um sistema de gerenciamento de dados mais robusto, as imagens dos módulos, cursos e fotos de usuários também estão sendo armazenadas diretamente na base de dados</p>
<img src="http://static.commentcamarche.net/pt.kioskea.net/pictures/H2fO1MKb-bando-de-dados-s-.png" class="img-responsive center-block">');
INSERT INTO licao VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 5 - Linguagens e ferramentas de construção', ' <img src="http://www.forecastit.pt/images/weblp.jpg" class="img-responsive center-block">
A codificação do backend do sistema foi realizada utilizando a linguagem de programação PHP com o paradigma de orientação a objetos. Todas as classes da camada model e controller utilizam a linguagem PHP. Não foi aplicado nenhum framework, assim a abordagem MVC foi construída manualmente de forma que toda a requisição dos controladores e seus métodos e feita pela index da raiz do sistema. O banco de dados foi criado utilizado o SGBD Postgres. 
A codificação do front end foi realizada utilizando a linguagem HTML para a criação das paginas, CSS para definição do estilo e JavaScript para interação dinâmica, validação de formulários e criação de cookies. Para que o sistema seja responsivo para aparelhos móveis, foi utilizado o framework Bootstrap.
  ');
INSERT INTO licao VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 2 - Recursos Educacionais Abertos (REA)', '     <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/03/Logotipo_Recursos_Educacionais_Abertos_(Vers%C3%A3o_em_Portugu%C3%AAs_do_Logotipo_Global).svg/850px-Logotipo_Recursos_Educacionais_Abertos_(Vers%C3%A3o_em_Portugu%C3%AAs_do_Logotipo_Global).svg.png" class="img-responsive center-block" width="400"><br>

Para a UNESCO os Recursos Educacionais Abertos são definidos como:
"REA são materiais de ensino, aprendizado e pesquisa, fixados em qualquer suporte ou mídia, que estejam sob domínio público ou licenciados de maneira aberta, permitindo que sejam utilizados ou adaptados por terceiros." (UNESCO) 
     ');
INSERT INTO licao VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'Lição 3 - Interface do sistema e Arquitetura de conteúdo WEB', 'Paula Filho define que o desenho das interfaces de usuário “abrange tanto o desenho externo (gráfico e funcional) das interfaces, quanto o desenho das classes de fronteira correspondentes”.Hoffer et al definem que o projeto da interface engloba formulários e relatórios que devem ser desenhados conforme critérios de objetivos de uso, propósitos, necessidades dos usuários e que tipos de usuários irão utiliza-los   ');
INSERT INTO licao VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 1 - Ensino a distancia', '<img src="http://institucional.caed.ufjf.br/wp-content/uploads/2014/08/EAD.jpg" class="img-responsive center-block">
<p>Atualmente com o acesso às informações facilitado pela internet e a crescente evolução do mercado de criação de novas tecnologias digitais, novas possibilidades de aprendizagem estão sendo criadas e difundidas por meio da grande rede.</p>
<p>A internet tem possibilitado a formação da inteligência coletiva, uma vez que é um espaço no qual os usuários geram grandes quantidades de informações com qualidade e agilidade impossíveis de obter utilizando um pequeno grupo de pessoas. 
Dentro deste contexto, diversas instituições de ensino também têm explorado as possibilidades da educação superior à distância. 
</p>          ');
INSERT INTO licao VALUES ('Modulo 1 - MOOC e REA', 19, 'Lição 3 - Curso Online Aberto Massivo (MOOC)', '<img src="http://goenglishmagazine.es/wp-content/uploads/2015/01/mooc.jpg" class="img-responsive center-block" width=400><br>
<p>O cenário atual destaca a extrema facilidade da adaptação das gerações as tecnologias digitais. No movimento crescente da Educação Aberta destaca-se o Curso Online Aberto e Massivo, em inglês Massive Online Open Course (MOOC). O MOOC é um ambiente online com um ou mais assuntos específicos, que explora as tecnologias da internet  para qualquer pessoa que queira fazer um curso. Possui como principais características: ser aberto, ser gratuito, colaborativo e distribuído.</p>
<p>Os cursos MOOC compartilham da mesma estrutura de cursos convencionais, com um cronograma pré-definido ou tópicos semanais, porém, os cursos deste modelo normalmente não são pagos nem requerem pré-requisitos. Também não predefinem expectativas de participação ou uma certificação formal, embora algumas plataformas apresentem opções de emissão de certificado de conclusão do curso.</p>');


