INSERT INTO modulo VALUES ('Modulo 1 - MOOC e REA', 19, 'NULL', '<h3>MOOC e REA</h3>
<p> Segundo a Sociedade Brasileira de Computação, os Recursos  Educacionais Abertos (REAs) são conjuntos de cursos completos, conteúdos  avulsos, módulos, livros, vídeos, testes, softwares e outras ferramentas,  materiais ou técnicas, disponibilizados gratuitamente para apoiar e facilitar o  acesso ao conhecimento. Atualmente com o acesso às informações facilitado pela  internet e a crescente evolução do mercado de criação de novas tecnologias  digitais, novas possibilidades de aprendizagem estão sendo criadas e difundidas  por meio da grande rede. </p>
<p> Neste  contexto, os Cursos Online Abertos Massivos, em inglês Massive Online Open  Course (MOOC), surgem como uma modalidade de curso ofertado de forma gratuita,  geralmente para qualquer pessoa com acesso à internet em qualquer lugar do  mundo. Este modelo integra três elementos: a conectividade das redes sociais, o  conhecimento de um especialista em determinada área e a coleção de recursos  online abertos. Assim, permite um engajamento ativo de dezenas ou centenas de  milhares de estudantes que auto organizam sua participação de acordo com suas  metas, conhecimentos prévios, habilidades e interesse comum.</p>', 41508);
INSERT INTO modulo VALUES ('Modulo 2 - Estrutura e funcionamento da plataforma', 19, 'NULL', 'Neste módulo será descrito a arquitetura, funcionamento e ferramentas utilizadas para a construção desta plataforma MOOC. 
A arquitetura deste projeto é decomposta em componentes que são estruturados: diagramas UML de pacotes, classes e sequência; Diagramas lógicos e matriz CRUD da base de dados; e diagrama objetivos do usuário e paginas de interação do projeto da interface. São complementados também os diagramas de conteúdo web.
', 49152);


