INSERT INTO pagina VALUES ('Programa de estudo', 19, 'Programa de estudo|Bibliografia MOOC e REA|Bibliografia Projeto e construção do sistema|$<p><b>- Modulo 1:</b> Contém uma breve descrição do que se trata REA e MOOC, comenta a evolução do ensino a distância, apresenta o uso de REA e apresenta alguns das principais plataformas MOOC atuais. </p>
