INSERT INTO pagina VALUES ('Pagina Inicial', 19, 'Sobre a demonstração|Como funciona|Programa de estudo|Discussão|Material adicional|Mídia Social|Lição |Progresso|$Esta demonstração tem por objetivo fazer um rápido ensaio para descrever do que se trata este projeto no contexto do ensino a distancia e recursos educacionais abertos. Esta plataforma foi desenvolvida como componente curricular do Trabalho Final de Graduação do aluno Kayque Willy Reis de Oliveira, do curso de Sistemas de Informação da Universidade Federal de Itajubá - UNIFEI. A demonstração contém dois módulos que dividem respectivamente o conteúdo abordado neste trabalho. O primeiro módulo se trata de ensino a distancia e o segundo módulo apresenta a estrutura da plataforma. 
<img src="https://omlfva-dm2306.files.1drv.com/y3mr-S_ZNFLlq_Hts7DnLGvaX6PA8tAsvWpVDxeuUxs9fCBZ8XMu8ZP-YHo4Sva2K81RzCiS27rJrLNQDN5w9QkJ75IeUFTwP8ApalRjzU7hmE1PpQ21eBUSb8bZHhHcJCBU0lxTtCkMgaUnp7tlFIJQ8WTBBLvGFxm5WH-n5wbmKI" class="img-responsive center-block" width="400">|<p>Todos os cursos da plataforma possuem a mesma pagina que é denominada classroom. Na classroom é possível navegar pelas paginas do curso, como a pagina inicial e a pagina de conteúdo programático, fórum de discussão, consultar o material adicional do curso, wikis que contém artigos anexados pelos alunos, paginas sociais do curso, realizar as lições e consultar o progresso. </p>
<p>O acesso a classroom é livre para qualquer pessoa que acessar a plataforma, no entanto para poder realizar interações no fórum, anexar artigos e acompanhar o progresso individual é necessário o cadastro do aluno na plataforma. O cadastro pode ser feito rapidamente acessando o menu superior direito. </p>
<img src="https://pmnmdw-dm2306.files.1drv.com/y3me_M6F3dPWSgfwpulX5jnQfZvOPCS57QtmH443S58aE3mn6qvfQsbg7bOg8o6L_1k2L-3XeYBDhFv1mA85tu3H2Xzg2lW3VSukfYDWGgLN1jzvpFiHMedu-vZCd-IuM25-eh2VHQxNPw-WaREV-w3zgU0ACWUfcw9xjGesQUWuN4" class="img-responsive center-block" width="900">|A pagina de programa de estudo serve para demonstrar a organização pedagógica do curso, sua duração (se tiver) e quaisquer outras recomendações que o tutor ache necessário destacar para os alunos. É nesta página que que são descritas também as fontes e referências que foram usadas para a construção do curso|A discussão de cada curso é um mini fórum onde os alunos podem interagir para discutir o conteúdo do curso, postar dúvidas e ajudar outros alunos. |Esta página contém qualquer material extra que o tutor tenha designado para algum módulo do curso. Os materiais extras podem ser qualquer fonte de referência que complementam o conteúdo do curso como livros textos, apostilas, artigos  e trabalhos acadêmicos, publicações científicas, cartilhas, etc.|A pagina de mídia social contém links para grupos, paginas ou perfis referentes ao curso em redes sociais como o Facebook e Twitter. |A lição é o curso propriamente dito. Na lição o aluno pode acompanhar os módulos do curso que contém cada um suas próprias lições. As lições do curso contém conteúdo multimídia de acesso livre. Assim fica a critério do aluno a sua assiduidade para realizar as lições em seu próprio ritmo. As lições podem ser repetidas e consultadas sempre que o aluno desejar. O conteúdo multimídia das lições se auto complementam, podendo fazer referência a materiais externos de terceiros, princípio fundamental dos Recursos Educacionais Abertos. Assim o curso é auto agregado.|A sessão de progresso serve como relatório de conclusão do curso. Os relatórios são simples e apresentam apenas o percentual completo do curso, dos módulos e das lições. Assim o aluno poderá ter noção do conteúdo visto e o restante para a conclusão do curso. |#sessao|sessao|sessao|sessao|sessao|sessao|sessao|sessao|&');


